Template.navBarTemplate.events({
	'click #recommendationsBtn' : function(){
		//console.log("A quien seguir");
	},
	'click #imgProfile' : function(){
		window.location = "/myProfile";
	},
	'click #imgLogTwiiterClone' : function(){
		window.location = "/";
	} 
});
